import React, { useState } from 'react';

const Title = (props) => {
  console.log(props)
  return (
    <h1>{props.text}</h1>
  )
}

const Button = (props) => {
  console.log(props)
  return (
    <button onClick = {props.handClick}>
      {props.text}
    </button>
  )
}

const Heading = (props) => {
  console.log(props)
  return (
      <h2>{props.text}</h2>
    )
}

const Counts = (props) => {
  console.log(props)
  return (
    <div>
      <p>{props.text[0]}</p>
      <p>{props.text[1]}</p>
      <p>{props.text[2]}</p>
    </div>
  )
}

const App = () => {
  const [good, SetGood] = useState(0)
  const [neutral, SetNeutral] = useState(0)
  const [bad, SetBad] = useState(0)

  const options = ['Good', 'Neutral', 'Bad']

  const handleGood = () => {
    console.log(good)
    SetGood(good + 1)
  }


  return (
    <div>
      <Title text = 'Please provide feedback'/>
      <Button text = 'Good' onClick = {handleGood} />
      <Button text = 'Neutral'/>
      <Button text = 'Bad'/>
      <Heading text = 'Statistics'/>
      <Counts text = {options} />
    </div>

  )
}

export default App;
